[[module css]]
.warning-box {
    display: block;
    width: 90%;
    height: auto;
    text-align:center;
    overflow: visible;
    margin: 0px 5% 10px 5%;
}

.warning-img {
    width: 14%;
    height: auto;
    padding: 5px;
    display: table-cell;
    vertical-align: middle;
}

.warning-text {
    max-width: 80%;
    width: 80%;
    display: table-cell;
    padding: 5px;
}

.warning-text p {
    display: inline-block;
    padding: 5px;
}
[[/module]]

